    def getDouble_1(self):
        d, okPressed = QInputDialog.getDouble(self.centralwidget, "Goal latitude","Value:", 0.0, -180, 180, 10)
        if okPressed:
            #print( d)
            self.goal_latitude_label.setText(str(d))
            self.goal_latitude_variable_label.setText("Goal latitude" +str(self.i+1)+':')
            self.arr_lat.data.insert(self.i,d)
            self.i+=1

        if self.i==self.n:
            self.entered_arr_lat_pub.publish(self.arr_lat)
        else:
            pass
      
    def getDouble_2(self):
        d, okPressed = QInputDialog.getDouble(self.centralwidget, "Goal latitude","Value:", 0.0, -180, 180, 10)
        if okPressed:
            #print( d)
            self.goal_longitude_label.setText(str(d))
            self.goal_longitude_variable_label.setText("Goal longitude" +str(self.j+1)+":")
            self.arr_lon.data.insert(self.j,d)
            self.j+=1

        if self.j==self.n:
            self.entered_arr_long_pub.publish(self.arr_lon)
            self.instruction_label.clear()
            self.instruction_label.setText("Press the start button !")
        else:
            pass

    def clear_pressed(self):
        self.n=0
        self.i=0
        self.j=0
        self.arr_lat.data.clear()
        self.arr_lon.data.clear()       

    def getDouble_3(self):
        self.n, okPressed = QInputDialog.getDouble(self.centralwidget, "Total no. of Goal","Value:", 0.0, -180, 180, 10)
